import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css"
import Sdata from "./App"




ReactDOM.render(
  <>
  <h1 className = 'heading'> Integrated-Home Unified Stability Test System </h1>

  <Card

        sname={Sdata[0].sname}
        imgsrc={Sdata[0].imgsrc}
        title={Sdata[0].title}
        links={Sdata[0].links}


  />


  </>

  ,document.getElementById('root')
);
